import ReactDOM from 'react-dom';
import xml2js from 'xml2js';

function Sitemap() {
    var sitemapJson = fetchSitemap("https://www.smu.edu.sg/sitemap.xml");
        console.log(sitemapJson.url);
    return (
        <p>Sitemap content</p>
    );
}

function fetchSitemap(url) {
    fetch(url)
    .then(res => res.text())
    .then(xmldata => {
        var parser = new xml2js.Parser();
        let json = '';
        parser.parseString(xmldata, function (err, result) {
            json = result;
        });
        console.log(json);
        return json;
    });    
}

export default Sitemap;
